import { dateb } from '../dateBase/dateb';

class Services extends Component {
   state = {
       base: dateb
   }

    render() {

        let {base} = this.state
        let flexOne = "d-flex justify-content-center align-items-center mt-5"
        return (
            <section className="bgTwo">
            <div className="text-center mt-3">
                <small>SERVICES</small>
            <h2 className="fw-bold">Our Amazing Services</h2>
            <p className="mt-3">Lorem Ipsum is simply dummy text of the printing and typesetting industry.<br/>
            Lorem Ipsum has been the industry's standard dummy text ever</p>
            </div>

            <div className={flexOne}>
            {
                base.map((mybase) => {return(

                    <div className="card rounded " style={{width: "18rem"}}>
                    <div className="card-body">
                        <div className="cubeOrange">
                           <i className={mybase.classN}></i> 
                        </div>

                    <h5 className="card-title fw-bold">{mybase.title}</h5>
                    <p className="card-text"> {mybase.para}</p>
                    <p className="paraone"> <i className="fas fa-times-circle "></i> {mybase.pone}</p>
                    <p className="paratwo"> <i className="fas fa-times-circle"></i> {mybase.ptwo}</p>
                    <p className="parathree"> <i className="fas fa-times-circle"></i> {mybase.pthree}</p>
                </div>
            </div>

                )})
            }
            </div>


        </section>
        );
    }
}

export default Services;
